import PropTypes from "prop-types";
// nodejs library that concatenates classes
import classNames from "classnames";
const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
  });
function Login(props) {
    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
        setOpen(true);
      };

      const handleClose = () => {
        setOpen(false);
      };
      const {
        labelText,
        id,
        labelProps,
        inputProps,
        error,
        white,
        inputRootCustomClasses,
        success,
        handleChange,
        type
      } = props;

      const labelClasses = classNames({
        "labelRootError": error,
        "labelRootSuccess": success && !error
      });

      const underlineClasses = classNames({
        "underlineError": error,
        "underlineSuccess": success && !error,
        "underline": true,
        "whiteUnderline": white
      });

      const marginTop = classNames({
        [inputRootCustomClasses]: inputRootCustomClasses !== undefined
      });

      const inputClasses = classNames({
        "input": true,
        "whiteInput": white
      });

      let formControlClasses = "formControl";
      if (props.formControlProps) {
        formControlClasses = classNames(
          props.formControlProps.className,
          formControlClasses
        );
      }





  return  <div className="App">
  <form className="form">
  <FormControl {...props.formControlProps} className={formControlClasses}>
      {labelText !== undefined ? (
        <InputLabel
          className={classNames("labelRoot", labelClasses)}
          htmlFor={id}
          {...labelProps}
        >
          {labelText}
        </InputLabel>
      ) : null}
      <Input
        classes={{
          input: inputClasses,
          root: marginTop,
          disabled: "disabled",
          underline: underlineClasses
        }}
        id={id}
        onChange={handleChange}
        {...inputProps}
        type={type}
      />
    </FormControl>
    <FormControl {...props.formControlProps} className={formControlClasses}>
      {labelText !== undefined ? (
        <InputLabel
          className={classNames("labelRoot", labelClasses)}
          htmlFor={id}
          {...labelProps}
        >
          {labelText}
        </InputLabel>
      ) : null}
      <Input
        classes={{
          input: inputClasses,
          root: marginTop,
          disabled: "disabled",
          underline: underlineClasses
        }}
        id={id}
        onChange={handleChange}
        {...inputProps}
        type={type}
      />
    </FormControl>

    <Button type="button" color="primary" className="form__custom-button">
      Log in
    </Button>
  </form>
</div>
